import classes from "./CityDetailsTab.module.css";

const CityDetailsTab = (city) => {
  return (
    <div className={classes.details}>
      <h1>OVO SU MADAFAKA DETALJI</h1>
    </div>
  );
};

export default CityDetailsTab;
